//{{{  init

const nodeHost = (typeof process) != 'undefined';

const fs = (nodeHost) ? require('fs') : 0;

const nodes = Array(MAX_PLY);

let silentMode = 0;
let randomEval = 0;

//{{{  initOnce

function initOnce () {

  //{{{  init net
  
  for (let i=0; i < NET_I_SIZE; i++)
    net_h1_w[i] = new Int32Array(NET_H1_SIZE);
  
  for (let i=0; i < NET_I_SIZE; i++)
    net_h2_w[i] = net_h1_w[flipIndex(i)];
  
  for (let i = 0; i < 64; i++) {
  
    const j = B88[i];
  
    IMAP[(W_PAWN << 8) + j]    =   0 + (PAWN-1)   * 64 + i;
    IMAP[(W_KNIGHT << 8) + j]  =   0 + (KNIGHT-1) * 64 + i;
    IMAP[(W_BISHOP << 8) + j]  =   0 + (BISHOP-1) * 64 + i;
    IMAP[(W_ROOK << 8) + j]    =   0 + (ROOK-1)   * 64 + i;
    IMAP[(W_QUEEN << 8) + j]   =   0 + (QUEEN-1)  * 64 + i;
    IMAP[(W_KING << 8) + j]    =   0 + (KING-1)   * 64 + i;
  
    IMAP[(B_PAWN << 8) + j]    = 384 + (PAWN-1)   * 64 + i;
    IMAP[(B_KNIGHT << 8) + j]  = 384 + (KNIGHT-1) * 64 + i;
    IMAP[(B_BISHOP << 8) + j]  = 384 + (BISHOP-1) * 64 + i;
    IMAP[(B_ROOK << 8) + j]    = 384 + (ROOK-1)   * 64 + i;
    IMAP[(B_QUEEN << 8) + j]   = 384 + (QUEEN-1)  * 64 + i;
    IMAP[(B_KING << 8) + j]    = 384 + (KING-1)   * 64 + i;
  
  }
  
  if (NET_WEIGHTS_FILE)
    netLoad();
  else
    netInitWeights();
  
  //}}}
  //{{{  init nodes
  
  for (let i=0; i < nodes.length; i++) {
    nodes[i] = new nodeStruct();
    seal(nodes[i]);
    nodes[i].ply = i;
  }
  
  for (let i=0; i < nodes.length-1; i++)
    nodes[i].childNode = nodes[i+1];
  
  for (let i=1; i < nodes.length; i++)
    nodes[i].parentNode = nodes[i-1];
  
  for (let i=2; i < nodes.length; i++)
    nodes[i].grandparentNode = nodes[i-2];
  
  //}}}
  //{{{  init LMR_LOOKUP
  
  for (let p=0; p < MAX_PLY; p++) {
    for (let m=0; m < MAX_MOVES; m++) {
      LMR_LOOKUP[(p << 7) + m] = 1 + p/5 + m/20 | 0;
    }
  }
  
  //}}}
  //{{{  init ALIGNED
  
  for (var i=0; i < 144; i++) {
    ALIGNED[i] = new Int8Array(144).fill(EDGE);
    for (let j=0; j < 64; j++) {
      ALIGNED[i][B88[j]] = 0;
    }
  }
  
  for (let i=0; i < 64; i++) {
  
    const to = B88[i];
    const a  = ALIGNED[to];
  
    let dir = 1;
    let from = to + dir;
    while (a[from] != EDGE) {
      a[from] = dir;
      from += dir;
    }
  
    dir = -1;
    from = to + dir;
    while (a[from] != EDGE) {
      a[from] = dir;
      from += dir;
    }
  
    dir = 12;
    from = to + dir;
    while (a[from] != EDGE) {
      a[from] = dir;
      from += dir;
    }
  
    dir = -12;
    from = to + dir;
    while (a[from] != EDGE) {
      a[from] = dir;
      from += dir;
    }
  
    dir = 13;
    from = to + dir;
    while (a[from] != EDGE) {
      a[from] = dir;
      from += dir;
    }
  
    dir = -13;
    from = to + dir;
    while (a[from] != EDGE) {
      a[from] = dir;
      from += dir;
    }
  
    dir = 11;
    from = to + dir;
    while (a[from] != EDGE) {
      a[from] = dir;
      from += dir;
    }
  
    dir = -11;
    from = to + dir;
    while (a[from] != EDGE) {
      a[from] = dir;
      from += dir;
    }
  
  }
  
  //}}}

}

